export const slideImages = () => {
    const imgArray =[];
    for (let i=0; i<29 ;i+=1){
        imgArray[i] = {
            id: "slide"+i+1,
            img: require("../../assets/images/2020-"+69+i+".png"),
            alt: "slide1"
        }
    }
    return imgArray;
}
